&quot;I... I shall consume. Consume... Consume everything..&quot;  
The Moon is a prominent part of The Legend of Zelda: Majora's Mask. Before the events of the game, the Skull Kid used the power of Majora's Mask to direct the moon on a collision course with Termina. The Moon approaches Termina slowly before a seemingly inevitable impact on the Final Day. Some of the people of Clock Town flee in an attempt to escape the collision, some do not believe it will fall, and others are resigned to the impending cataclysm. The moon has an enraged or perhaps insane facial expression throughout the game. A statement from one of the Twins indicates that the Moon did not look like this prior to the actions of the Skull Kid. It is unknown if the Moon had a face at all before the events of the game.  
